import React from "react";
import { Link } from "@reach/router";

const Homepage = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
            <Link to="/topics">Topics</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default Homepage;
